Solve the following math problem: If a recipe calls for 3 cups of flour and you want to make half the recipe, how much flour do you need?
Answer:

\begin{align*}
\frac{1}{2} \times 3 &= 1.5 \end{align*}
If a recipe calls for 3 cups of flour and you want to make half the recipe, you need 1.5 cups of flour.
